import React from "react";
import Logo from "../assets/img/document-share.png";
import SearchBox from "./search-box";

const Header = () => {
    return(
        <>
            <div className="header">
                <div className="logo">
                    <img src={Logo} alt="Logo" />
                </div>
            </div>
            <div className="search-box">
                          
            </div>
        </>
    )
}

export default Header;
